  CREATE OR REPLACE PACKAGE BODY "MADALINA"."USERPACKAGE" AS
   FUNCTION verificareEmail (p_email USERS.email%TYPE) 
   RETURN NUMBER AS
        contor NUMBER;
   BEGIN
        SELECT COUNT(email) INTO contor FROM USERS WHERE email = p_email;
        IF contor = 0 THEN 
            RETURN 0; --nu exista email
        ELSIF contor = 1 THEN 
            RETURN 1; --exista email
        END IF;
   END verificareEmail;

   FUNCTION inregistrareUser (p_first_name USERS.first_name%TYPE, p_last_name USERS.last_name%TYPE, p_email USERS.email%TYPE, p_password USERS.password%TYPE) 
   RETURN NUMBER AS
        v_id USERS.id%TYPE;
        user_existent EXCEPTION;
        PRAGMA EXCEPTION_INIT(user_existent, -20001);
   BEGIN
        SELECT id + 1 INTO v_id FROM (SELECT id FROM users ORDER BY id DESC) WHERE ROWNUM <= 1;
        IF verificareEmail(p_email) = 0 THEN 
            RETURN 1;
        ELSE
            raise user_existent;
            RETURN 0;
        END IF;
        EXCEPTION 
        WHEN user_existent THEN
            raise_application_error (-20001,'User-ul cu e-mail-ul ' || p_email || ' este existent in baza de date.');
   END inregistrareUser;

   PROCEDURE conectareUser (out_token OUT users.token%type, p_email USERS.email%TYPE, p_password USERS.password%TYPE) 
   AS
        user_existent EXCEPTION;
        PRAGMA EXCEPTION_INIT(user_existent, -20002);
        v_password USERS.password%TYPE;
        v_token users.token%type;
   BEGIN
        IF verificareEmail(p_email) = 1 THEN
            SELECT password INTO v_password FROM USERS WHERE email = p_email;
            IF v_password = p_password THEN
                v_token := dbms_obfuscation_toolkit.md5(input => UTL_RAW.cast_to_raw(p_email));
                out_token := v_token;
                UPDATE USERS SET TOKEN = v_token WHERE email = p_email;
            ELSE
                out_token := '';
                raise user_existent;
            END IF;
        ELSE
            out_token := '';
            raise user_existent;
        END IF;
        
        EXCEPTION
        WHEN user_existent THEN
            raise_application_error (-20002,'Email sau parola gresita. Incercati din nou.');
   END conectareUser;
   
   
   FUNCTION updatePassword (p_email USERS.email%TYPE, p_password USERS.password%TYPE) 
   RETURN NUMBER AS
   BEGIN
      IF verificareEmail(p_email) = 1 THEN
          UPDATE USERS SET password = p_password WHERE email = p_email;
          RETURN 1;
      ELSE
          RETURN 0;
      END IF;
   END updatePassword;
   
   PROCEDURE verificareToken (out_result OUT NUMBER,p_token users.token%type) 
   as
      v_count NUMBER;
   BEGIN
      SELECT COUNT(1) INTO v_count FROM USERS WHERE token = p_token;
      IF v_count = 1 THEN
          out_result := 1;
      ELSE
          out_result := 0;
      END IF;
   END verificareToken;
   
    FUNCTION validate_product(p_product_id products.id%type, p_user_id users.id%type) 
    RETURN INTEGER AS
      v_product_line products%rowtype;
      cursor curs_boli is select * from user_disease where user_id=p_user_id;
      v_nr_boli number;
      v_curs_linie curs_boli%rowtype;
      v_boli_linie diseases%rowtype;
    BEGIN
      select * into v_product_line from products where id=p_product_id;
      select count(*) into v_nr_boli from user_disease where user_id=p_user_id;
      if v_nr_boli =0 then 
        return 1;
      else
      
      FOR v_curs_linie IN  curs_boli LOOP     
        select * into v_boli_linie from diseases where id=v_curs_linie.user_id;
        if(v_boli_linie.salt is not null and v_product_line.salt is not null and v_boli_linie.salt>=v_product_line.salt) then
          return -1; -- nu e buna pentru user;
        elsif (v_boli_linie.sugar is not null and v_product_line.sugar is not null and v_boli_linie.sugar>=v_product_line.sugar) then
          return -2;
        elsif (v_boli_linie.fats is not null and v_product_line.fats is not null and v_boli_linie.fats>=v_product_line.fats) then
          return -3;
        elsif (v_boli_linie.carbohydrate is not null and v_product_line.carbohydrate is not null and v_boli_linie.carbohydrate>=v_product_line.carbohydrate) then
          return -4;
        elsif (v_boli_linie.fiber is not null and v_product_line.fiber is not null and v_boli_linie.fiber>=v_product_line.fiber) then
          return -5;
        elsif (v_boli_linie.protein is not null and v_product_line.protein is not null and v_boli_linie.protein>=v_product_line.protein) then
          return -6;
        elsif (v_boli_linie.calories is not null and v_product_line.calories is not null and v_boli_linie.calories>=v_product_line.calories) then
          return -7;
        elsif (v_boli_linie.saturates is not null and v_product_line.saturates is not null and v_boli_linie.saturates>=v_product_line.saturates) then
          return -8;
        else return 1;
        end if;
      END LOOP; 
      end if;

END;
   
END userPackage;

